  [],\n\t\"revision_timestamp\": \"2015-05-06T21:47:49.991942\",\n\t\"name\": \"vacuum-plasma-spray-formed-high-transition-temperature-shape-memory-alloys-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Smart materials control of aero-surfaces
  based on shape memory alloysn(SMA) is seeing increased use for improving of future
  subsonic fixednwing aircraft aero-surface controls. Such SMA actuators have thenpotential
  of lowering weight and increasing reliability through directncontrol. The binary
  NiTi system has been a preferred system but thesenalloys have austenite finish Af
  transition temperature in a reportednrange of 90 - 100C, which is too low for many
  applications. Therefore,nthere is strong interest in developing a class of ternary
  and/ornquaternary alloys that incorporate Pd and/or other elemental additions.nMRi
  is proposing to develop NiTiPd and NiTiPd+ X alloys that are capablenof being directly
  formed via vacuum plasma spray (VPS) processing. Thesenalloys have been shown to
  increase Af transformation temperature to overn350C, however, these alloys are also
  significantly less ductile and morenprone to casting segregation. The proposed innovation
  has the potentialnto eliminate the typical cast/rolling/extrusion procedures typicallynused
  with NiTi alloys with a near-net vacuum plasma spray (VPS) formingnprocess. If successful,
  the alloy and process development work to benconducted on the Phase I investigation
  would enable the VPS process tondirectly form shapes from NiTiPd-X alloys. The proposed
  Phase I researchnwould be aimed at developing specific NiTiPd+X where X could be
  Hf, Zrnand even B. The development work would focus on developing as depositednstructures
  that would yield Af transition temperature from 130 - 300C.nIf successful, the development
  would enable the cost effectivenmanufacture of higher temperature shape memory alloy
  actuators for usenas remote actuation of aero-control surface and engine controls.\",\n\t\"license_title\":
